import React, { Component, Fragment} from 'react'
import Button from '@material-ui/core/Button';

class searchSection extends Component {

  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div>

        <style jsx>
          {`
            .root{
              width:100%;
              height:120px;
              background:ghostwhite;
            }
          `}
        </style>
        <div className="root">
            <h1>Hola!</h1>
            <p>Explora las tiendas y negocios de tu barrio.</p>
            <Button
              variant="contained"
              color="primary"
              size="large"
              className={classes.button}
              startIcon={<SaveIcon />}
            >
              Save
            </Button>
        </div>
      </div>
    )
  }
}

export default searchSection;
